#ifndef SIMPLE_CALCULATOR_H
#define SIMPLE_CALCULATOR_H

#include "../config/simpleCalculatorCfg.h"

#ifdef __cplusplus
extern "C" {
#endif

/**
 * @brief Result structure for calculator operations
 */
typedef struct {
    double value;
    int error_code;
} SimpleCalculatorResult;

/**
 * @brief Error codes for calculator operations
 */
typedef enum {
    SIMPLE_CALC_SUCCESS = 0,
    SIMPLE_CALC_ERROR_DIVISION_BY_ZERO = 1,
    SIMPLE_CALC_ERROR_INVALID_INPUT = 2,
    SIMPLE_CALC_ERROR_OVERFLOW = 3
} SimpleCalculatorErrorCode;

/**
 * @brief Add two numbers
 * @param a First operand
 * @param b Second operand
 * @return Result structure containing sum and error code
 */
SimpleCalculatorResult simpleCalculator_add(double a, double b);

/**
 * @brief Subtract two numbers
 * @param a First operand (minuend)
 * @param b Second operand (subtrahend)
 * @return Result structure containing difference and error code
 */
SimpleCalculatorResult simpleCalculator_subtract(double a, double b);

/**
 * @brief Multiply two numbers
 * @param a First operand
 * @param b Second operand
 * @return Result structure containing product and error code
 */
SimpleCalculatorResult simpleCalculator_multiply(double a, double b);

/**
 * @brief Divide two numbers
 * @param a Dividend
 * @param b Divisor
 * @return Result structure containing quotient and error code
 */
SimpleCalculatorResult simpleCalculator_divide(double a, double b);

/**
 * @brief Get error message for given error code
 * @param error_code Error code from SimpleCalculatorErrorCode enum
 * @return String description of the error
 */
const char* simpleCalculator_getErrorMessage(SimpleCalculatorErrorCode error_code);

#ifdef __cplusplus
}
#endif

#endif /* SIMPLE_CALCULATOR_H */

#include "../inc/simpleCalculator.h"
#include <math.h>
#include <float.h>

static int checkOverflow(double value) {
#if SIMPLE_CALC_ENABLE_OVERFLOW_CHECK
    if (isfinite(value) && fabs(value) <= SIMPLE_CALC_MAX_VALUE) {
        return 0; // No overflow
    }
    return 1; // Overflow detected
#else
    return 0; // Overflow check disabled
#endif
}

SimpleCalculatorResult simpleCalculator_add(double a, double b) {
    SimpleCalculatorResult result;

    SIMPLE_CALC_DEBUG_PRINT("Adding %.2f + %.2f", a, b);

    result.value = a + b;

    if (checkOverflow(result.value)) {
        result.error_code = SIMPLE_CALC_ERROR_OVERFLOW;
        result.value = 0.0;
    } else {
        result.error_code = SIMPLE_CALC_SUCCESS;
    }

    return result;
}

SimpleCalculatorResult simpleCalculator_subtract(double a, double b) {
    SimpleCalculatorResult result;

    SIMPLE_CALC_DEBUG_PRINT("Subtracting %.2f - %.2f", a, b);

    result.value = a - b;

    if (checkOverflow(result.value)) {
        result.error_code = SIMPLE_CALC_ERROR_OVERFLOW;
        result.value = 0.0;
    } else {
        result.error_code = SIMPLE_CALC_SUCCESS;
    }

    return result;
}

SimpleCalculatorResult simpleCalculator_multiply(double a, double b) {
    SimpleCalculatorResult result;

    SIMPLE_CALC_DEBUG_PRINT("Multiplying %.2f * %.2f", a, b);

    result.value = a * b;

    if (checkOverflow(result.value)) {
        result.error_code = SIMPLE_CALC_ERROR_OVERFLOW;
        result.value = 0.0;
    } else {
        result.error_code = SIMPLE_CALC_SUCCESS;
    }

    return result;
}

SimpleCalculatorResult simpleCalculator_divide(double a, double b) {
    SimpleCalculatorResult result;

    SIMPLE_CALC_DEBUG_PRINT("Dividing %.2f / %.2f", a, b);

    // Check for division by zero
    if (fabs(b) < SIMPLE_CALC_EPSILON) {
        result.error_code = SIMPLE_CALC_ERROR_DIVISION_BY_ZERO;
        result.value = 0.0;
        return result;
    }

    result.value = a / b;

    if (checkOverflow(result.value)) {
        result.error_code = SIMPLE_CALC_ERROR_OVERFLOW;
        result.value = 0.0;
    } else {
        result.error_code = SIMPLE_CALC_SUCCESS;
    }

    return result;
}

const char* simpleCalculator_getErrorMessage(SimpleCalculatorErrorCode error_code) {
    switch (error_code) {
        case SIMPLE_CALC_SUCCESS:
            return "Operation successful";
        case SIMPLE_CALC_ERROR_DIVISION_BY_ZERO:
            return "Division by zero error";
        case SIMPLE_CALC_ERROR_INVALID_INPUT:
            return "Invalid input error";
        case SIMPLE_CALC_ERROR_OVERFLOW:
            return "Arithmetic overflow error";
        default:
            return "Unknown error";
    }
}

