TEST_F(SimpleCalculatorTest, AdditionPositiveNumbers) {
    SimpleCalculatorResult result = simpleCalculator_add(5.0, 3.0);
    EXPECT_EQ(result.error_code, SIMPLE_CALC_SUCCESS);
    EXPECT_DOUBLE_EQ(result.value, 8.0);
}

TEST_F(SimpleCalculatorTest, AdditionNegativeNumbers) {
    SimpleCalculatorResult result = simpleCalculator_add(-5.0, -3.0);
    EXPECT_EQ(result.error_code, SIMPLE_CALC_SUCCESS);
    EXPECT_DOUBLE_EQ(result.value, -8.0);
}

TEST_F(SimpleCalculatorTest, AdditionMixedNumbers) {
    SimpleCalculatorResult result = simpleCalculator_add(5.0, -3.0);
    EXPECT_EQ(result.error_code, SIMPLE_CALC_SUCCESS);
    EXPECT_DOUBLE_EQ(result.value, 2.0);
}

