    SimpleCalculatorResult result = simpleCalculator_subtract(3.0, 8.0);
    EXPECT_EQ(result.error_code, SIMPLE_CALC_SUCCESS);
    EXPECT_DOUBLE_EQ(result.value, -5.0);
