    SimpleCalculatorResult result = simpleCalculator_divide(5.0, 0.0);
    EXPECT_EQ(result.error_code, SIMPLE_CALC_ERROR_DIVISION_BY_ZERO);
    EXPECT_DOUBLE_EQ(result.value, 0.0);
