#ifndef PROGRAMMER_CALCULATOR_H
#define PROGRAMMER_CALCULATOR_H

#include "../config/programmerCalculatorCfg.h"
#include <stdint.h>
#include <stdbool.h>

#ifdef __cplusplus
extern "C" {
#endif

/**
 * @brief Number base types supported by programmer calculator
 */
typedef enum {
    PROG_CALC_BASE_BINARY = 2,
    PROG_CALC_BASE_OCTAL = 8,
    PROG_CALC_BASE_DECIMAL = 10,
    PROG_CALC_BASE_HEXADECIMAL = 16
} ProgrammerCalculatorBase;

/**
 * @brief Error codes for programmer calculator operations
 */
typedef enum {
    PROG_CALC_SUCCESS = 0,
    PROG_CALC_ERROR_INVALID_BASE = 1,
    PROG_CALC_ERROR_INVALID_INPUT = 2,
    PROG_CALC_ERROR_OVERFLOW = 3,
    PROG_CALC_ERROR_BUFFER_TOO_SMALL = 4
} ProgrammerCalculatorErrorCode;

/**
 * @brief Result structure for programmer calculator operations
 */
typedef struct {
    uint64_t value;
    ProgrammerCalculatorErrorCode error_code;
} ProgrammerCalculatorResult;

// Arithmetic operations
ProgrammerCalculatorResult progCalc_add(uint64_t a, uint64_t b);
ProgrammerCalculatorResult progCalc_subtract(uint64_t a, uint64_t b);
ProgrammerCalculatorResult progCalc_multiply(uint64_t a, uint64_t b);
ProgrammerCalculatorResult progCalc_divide(uint64_t a, uint64_t b);
ProgrammerCalculatorResult progCalc_modulo(uint64_t a, uint64_t b);

// Bitwise operations
ProgrammerCalculatorResult progCalc_bitwiseAnd(uint64_t a, uint64_t b);
ProgrammerCalculatorResult progCalc_bitwiseOr(uint64_t a, uint64_t b);
ProgrammerCalculatorResult progCalc_bitwiseXor(uint64_t a, uint64_t b);
ProgrammerCalculatorResult progCalc_bitwiseNot(uint64_t a);
ProgrammerCalculatorResult progCalc_leftShift(uint64_t value, uint8_t positions);
ProgrammerCalculatorResult progCalc_rightShift(uint64_t value, uint8_t positions);

// Base conversion operations
ProgrammerCalculatorErrorCode progCalc_numberToString(uint64_t value, ProgrammerCalculatorBase base, char* buffer, size_t buffer_size);
ProgrammerCalculatorResult progCalc_stringToNumber(const char* str, ProgrammerCalculatorBase base);

// Utility functions
bool progCalc_getBit(uint64_t value, uint8_t position);
ProgrammerCalculatorResult progCalc_setBit(uint64_t value, uint8_t position);
ProgrammerCalculatorResult progCalc_clearBit(uint64_t value, uint8_t position);
ProgrammerCalculatorResult progCalc_toggleBit(uint64_t value, uint8_t position);
uint8_t progCalc_countSetBits(uint64_t value);

// Error handling
const char* progCalc_getErrorMessage(ProgrammerCalculatorErrorCode error_code);

#ifdef __cplusplus
}
#endif

#endif /* PROGRAMMER_CALCULATOR_H */

#include "../inc/programmerCalculator.h"
#include <string.h>
#include <ctype.h>
#include <stdlib.h>

// Helper function to check for overflow in addition
static bool checkAdditionOverflow(uint64_t a, uint64_t b) {
#if PROG_CALC_ENABLE_OVERFLOW_CHECK
    return (a > UINT64_MAX - b);
#else
    return false;
#endif
}

// Helper function to check for overflow in multiplication
static bool checkMultiplicationOverflow(uint64_t a, uint64_t b) {
#if PROG_CALC_ENABLE_OVERFLOW_CHECK
    if (a == 0 || b == 0) return false;
    return (a > UINT64_MAX / b);
#else
    return false;
#endif
}

// Arithmetic operations
ProgrammerCalculatorResult progCalc_add(uint64_t a, uint64_t b) {
    ProgrammerCalculatorResult result;

    PROG_CALC_DEBUG_PRINT("Adding 0x%llx + 0x%llx", a, b);

    if (checkAdditionOverflow(a, b)) {
        result.error_code = PROG_CALC_ERROR_OVERFLOW;
        result.value = 0;
    } else {
        result.value = a + b;
        result.error_code = PROG_CALC_SUCCESS;
    }

    return result;
}

ProgrammerCalculatorResult progCalc_subtract(uint64_t a, uint64_t b) {
    ProgrammerCalculatorResult result;

    PROG_CALC_DEBUG_PRINT("Subtracting 0x%llx - 0x%llx", a, b);

    result.value = a - b;  // Underflow wraps around in unsigned arithmetic
    result.error_code = PROG_CALC_SUCCESS;

    return result;
}

ProgrammerCalculatorResult progCalc_multiply(uint64_t a, uint64_t b) {
    ProgrammerCalculatorResult result;

    PROG_CALC_DEBUG_PRINT("Multiplying 0x%llx * 0x%llx", a, b);

    if (checkMultiplicationOverflow(a, b)) {
        result.error_code = PROG_CALC_ERROR_OVERFLOW;
        result.value = 0;
    } else {
        result.value = a * b;
        result.error_code = PROG_CALC_SUCCESS;
    }

    return result;
}

ProgrammerCalculatorResult progCalc_divide(uint64_t a, uint64_t b) {
    ProgrammerCalculatorResult result;

    PROG_CALC_DEBUG_PRINT("Dividing 0x%llx / 0x%llx", a, b);

    if (b == 0) {
        result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
        result.value = 0;
    } else {
        result.value = a / b;
        result.error_code = PROG_CALC_SUCCESS;
    }

    return result;
}

ProgrammerCalculatorResult progCalc_modulo(uint64_t a, uint64_t b) {
    ProgrammerCalculatorResult result;

    PROG_CALC_DEBUG_PRINT("Modulo 0x%llx %% 0x%llx", a, b);

    if (b == 0) {
        result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
        result.value = 0;
    } else {
        result.value = a % b;
        result.error_code = PROG_CALC_SUCCESS;
    }

    return result;
}

// Bitwise operations
#if PROG_CALC_ENABLE_BITWISE_OPERATIONS

ProgrammerCalculatorResult progCalc_bitwiseAnd(uint64_t a, uint64_t b) {
    ProgrammerCalculatorResult result;
    result.value = a & b;
    result.error_code = PROG_CALC_SUCCESS;
    return result;
}

ProgrammerCalculatorResult progCalc_bitwiseOr(uint64_t a, uint64_t b) {
    ProgrammerCalculatorResult result;
    result.value = a | b;
    result.error_code = PROG_CALC_SUCCESS;
    return result;
}

ProgrammerCalculatorResult progCalc_bitwiseXor(uint64_t a, uint64_t b) {
    ProgrammerCalculatorResult result;
    result.value = a ^ b;
    result.error_code = PROG_CALC_SUCCESS;
    return result;
}

ProgrammerCalculatorResult progCalc_bitwiseNot(uint64_t a) {
    ProgrammerCalculatorResult result;
    result.value = ~a;
    result.error_code = PROG_CALC_SUCCESS;
    return result;
}

ProgrammerCalculatorResult progCalc_leftShift(uint64_t value, uint8_t positions) {
    ProgrammerCalculatorResult result;

    if (positions > PROG_CALC_MAX_SHIFT_POSITIONS) {
        result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
        result.value = 0;
    } else {
        result.value = value << positions;
        result.error_code = PROG_CALC_SUCCESS;
    }

    return result;
}

ProgrammerCalculatorResult progCalc_rightShift(uint64_t value, uint8_t positions) {
    ProgrammerCalculatorResult result;

    if (positions > PROG_CALC_MAX_SHIFT_POSITIONS) {
        result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
        result.value = 0;
    } else {
        result.value = value >> positions;
        result.error_code = PROG_CALC_SUCCESS;
    }

    return result;
}

#endif // PROG_CALC_ENABLE_BITWISE_OPERATIONS

// Base conversion operations
#if PROG_CALC_ENABLE_BASE_CONVERSION

ProgrammerCalculatorErrorCode progCalc_numberToString(uint64_t value, ProgrammerCalculatorBase base, char* buffer, size_t buffer_size) {
    if (buffer == NULL || buffer_size == 0) {
        return PROG_CALC_ERROR_INVALID_INPUT;
    }

    if (base != PROG_CALC_BASE_BINARY && base != PROG_CALC_BASE_OCTAL && 
        base != PROG_CALC_BASE_DECIMAL && base != PROG_CALC_BASE_HEXADECIMAL) {
        return PROG_CALC_ERROR_INVALID_BASE;
    }

    char temp[PROG_CALC_MAX_STRING_LENGTH];
    char digits[] = "0123456789ABCDEF";
    int index = 0;

    if (value == 0) {
        temp[index++] = '0';
    } else {
        while (value > 0 && index < PROG_CALC_MAX_STRING_LENGTH - 1) {
            temp[index++] = digits[value % base];
            value /= base;
        }
    }

    // Add prefix if needed
    const char* prefix = "";
    switch (base) {
        case PROG_CALC_BASE_BINARY:
            prefix = PROG_CALC_BINARY_PREFIX;
            break;
        case PROG_CALC_BASE_HEXADECIMAL:
            prefix = PROG_CALC_HEX_PREFIX;
            break;
        default:
            break;
    }

    size_t prefix_len = strlen(prefix);
    if (index + prefix_len >= buffer_size) {
        return PROG_CALC_ERROR_BUFFER_TOO_SMALL;
    }

    // Copy prefix
    strcpy(buffer, prefix);

    // Reverse and copy digits
    for (int i = index - 1; i >= 0; i--) {
        buffer[prefix_len + (index - 1 - i)] = temp[i];
    }
    buffer[prefix_len + index] = '\0';

    return PROG_CALC_SUCCESS;
}

ProgrammerCalculatorResult progCalc_stringToNumber(const char* str, ProgrammerCalculatorBase base) {
    ProgrammerCalculatorResult result;

    if (str == NULL) {
        result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
        result.value = 0;
        return result;
    }

    const char* start = str;

    // Skip prefixes
    if (strncmp(str, PROG_CALC_BINARY_PREFIX, 2) == 0) {
        start += 2;
        base = PROG_CALC_BASE_BINARY;
    } else if (strncmp(str, PROG_CALC_HEX_PREFIX, 2) == 0) {
        start += 2;
        base = PROG_CALC_BASE_HEXADECIMAL;
    }

    result.value = 0;

    for (const char* p = start; *p != '\0'; p++) {
        int digit_value;

        if (*p >= '0' && *p <= '9') {
            digit_value = *p - '0';
        } else if (*p >= 'A' && *p <= 'F') {
            digit_value = *p - 'A' + 10;
        } else if (*p >= 'a' && *p <= 'f') {
            digit_value = *p - 'a' + 10;
        } else {
            result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
            result.value = 0;
            return result;
        }

        if (digit_value >= base) {
            result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
            result.value = 0;
            return result;
        }

        result.value = result.value * base + digit_value;
    }

    result.error_code = PROG_CALC_SUCCESS;
    return result;
}

#endif // PROG_CALC_ENABLE_BASE_CONVERSION

// Utility functions
bool progCalc_getBit(uint64_t value, uint8_t position) {
    if (position >= PROG_CALC_MAX_REGISTER_SIZE) {
        return false;
    }
    return (value & (1ULL << position)) != 0;
}

ProgrammerCalculatorResult progCalc_setBit(uint64_t value, uint8_t position) {
    ProgrammerCalculatorResult result;

    if (position >= PROG_CALC_MAX_REGISTER_SIZE) {
        result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
        result.value = 0;
    } else {
        result.value = value | (1ULL << position);
        result.error_code = PROG_CALC_SUCCESS;
    }

    return result;
}

ProgrammerCalculatorResult progCalc_clearBit(uint64_t value, uint8_t position) {
    ProgrammerCalculatorResult result;

    if (position >= PROG_CALC_MAX_REGISTER_SIZE) {
        result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
        result.value = 0;
    } else {
        result.value = value & ~(1ULL << position);
        result.error_code = PROG_CALC_SUCCESS;
    }

    return result;
}

ProgrammerCalculatorResult progCalc_toggleBit(uint64_t value, uint8_t position) {
    ProgrammerCalculatorResult result;

    if (position >= PROG_CALC_MAX_REGISTER_SIZE) {
        result.error_code = PROG_CALC_ERROR_INVALID_INPUT;
        result.value = 0;
    } else {
        result.value = value ^ (1ULL << position);
        result.error_code = PROG_CALC_SUCCESS;
    }

    return result;
}

uint8_t progCalc_countSetBits(uint64_t value) {
    uint8_t count = 0;
    while (value) {
        count += value & 1;
        value >>= 1;
    }
    return count;
}

// Error handling
const char* progCalc_getErrorMessage(ProgrammerCalculatorErrorCode error_code) {
    switch (error_code) {
        case PROG_CALC_SUCCESS:
            return "Operation successful";
        case PROG_CALC_ERROR_INVALID_BASE:
            return "Invalid number base";
        case PROG_CALC_ERROR_INVALID_INPUT:
            return "Invalid input parameter";
        case PROG_CALC_ERROR_OVERFLOW:
            return "Arithmetic overflow";
        case PROG_CALC_ERROR_BUFFER_TOO_SMALL:
            return "Buffer too small for result";
        default:
            return "Unknown error";
    }
}

