// Test arithmetic operations
TEST_F(ProgrammerCalculatorTest, ArithmeticAddition) {
    ProgrammerCalculatorResult result = progCalc_add(10, 5);
    EXPECT_EQ(result.error_code, PROG_CALC_SUCCESS);
    EXPECT_EQ(result.value, 15);
}

TEST_F(ProgrammerCalculatorTest, ArithmeticSubtraction) {
    ProgrammerCalculatorResult result = progCalc_subtract(10, 3);
    EXPECT_EQ(result.error_code, PROG_CALC_SUCCESS);
    EXPECT_EQ(result.value, 7);
}

TEST_F(ProgrammerCalculatorTest, ArithmeticSubtractionUnderflow) {
    ProgrammerCalculatorResult result = progCalc_subtract(3, 10);
    EXPECT_EQ(result.error_code, PROG_CALC_SUCCESS);
    // Unsigned underflow wraps around
    EXPECT_EQ(result.value, UINT64_MAX - 6);
}

TEST_F(ProgrammerCalculatorTest, ArithmeticMultiplication) {
