// Overflow checking for floating point operations
int calculationCheck_floatOverflow(double value, double max_value) {
    CALC_CHECK_DEBUG_PRINT("Checking float overflow: value=%.2f, max=%.2f", value, max_value);

    if (isfinite(value) && fabs(value) <= max_value) {
        return 0; // No overflow
    }

    CALC_CHECK_DEBUG_PRINT("Float overflow detected!");
    return 1; // Overflow detected
}

// Overflow checking for integer addition
bool calculationCheck_additionOverflow(uint64_t a, uint64_t b) {
    CALC_CHECK_DEBUG_PRINT("Checking addition overflow: a=0x%llx, b=0x%llx", a, b);

    bool overflow = (a > UINT64_MAX - b);
    if (overflow) {
        CALC_CHECK_DEBUG_PRINT("Addition overflow detected!");
    }
    return overflow;
}

// Overflow checking for integer multiplication
bool calculationCheck_multiplicationOverflow(uint64_t a, uint64_t b) {
    CALC_CHECK_DEBUG_PRINT("Checking multiplication overflow: a=0x%llx, b=0x%llx", a, b);

    if (a == 0 || b == 0) return false;

    bool overflow = (a > UINT64_MAX / b);
    if (overflow) {
        CALC_CHECK_DEBUG_PRINT("Multiplication overflow detected!");
    }
    return overflow;
}

// Division by zero checking for floating point
bool calculationCheck_divisionByZero(double value, double epsilon) {
    CALC_CHECK_DEBUG_PRINT("Checking division by zero: value=%.9f, epsilon=%.9f", value, epsilon);

    bool isZero = (fabs(value) < epsilon);
    if (isZero) {
        CALC_CHECK_DEBUG_PRINT("Division by zero detected!");
    }
    return isZero;
}

// Division by zero checking for integers
bool calculationCheck_divisionByZeroInt(uint64_t value) {
    CALC_CHECK_DEBUG_PRINT("Checking integer division by zero: value=0x%llx", value);

    bool isZero = (value == 0);
    if (isZero) {
        CALC_CHECK_DEBUG_PRINT("Integer division by zero detected!");
    }
    return isZero;
